webpackJsonp([0xc50d8f1754b0],{7778:function(e,t){e.exports={data:{post:{html:'<p>MamaMaus has a business meeting in Westerland on the island of Sylt tomorrow afternoon, to be followed in the evening by a reception in the <a href="http://www.sansibar-sylt.de/">Sansibar</a> beach-side restaurant.</p>\n<p>The weather service is forecasting a <a href="http://www.spiegel.de/panorama/0,1518,460452,00.html">severe storm for all of Germany</a> tomorrow evening, especially severe on the North Sea coast, with winds in excess of 150 km/h.</p>\n<p>I hope she\'s not planning a moonlight walk on the beach.</p>',fields:{title:"Stormy Weather",date:"17 Jan 2007",url:"https://papascott.de/2007-01-17-stormy-weather/"}}},pathContext:{slug:"/2007-01-17-stormy-weather/",prev:{fields:{title:"Wine School",date:"16 Jan 2007",slug:"/2007-01-16-wine-school/"}},next:{fields:{title:"King Stoiber Abdicates",date:"18 Jan 2007",slug:"/2007-01-18-king-stoiber-abdicates/"}}}}}});
